BEGIN TRANSACTION;
CREATE TABLE "auth_group" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(80) NOT NULL UNIQUE);
CREATE TABLE "auth_group_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE "auth_permission" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "content_type_id" integer NOT NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "codename" varchar(100) NOT NULL, "name" varchar(255) NOT NULL);
CREATE TABLE "auth_user" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "password" varchar(128) NOT NULL, "last_login" datetime NULL, "is_superuser" bool NOT NULL, "username" varchar(150) NOT NULL UNIQUE, "first_name" varchar(30) NOT NULL, "email" varchar(254) NOT NULL, "is_staff" bool NOT NULL, "is_active" bool NOT NULL, "date_joined" datetime NOT NULL, "last_name" varchar(150) NOT NULL);
CREATE TABLE "auth_user_groups" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE "auth_user_user_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE "django_admin_log" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "object_id" text NULL, "object_repr" varchar(200) NOT NULL, "action_flag" smallint unsigned NOT NULL, "change_message" text NOT NULL, "content_type_id" integer NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "action_time" datetime NOT NULL);
CREATE TABLE "django_content_type" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app_label" varchar(100) NOT NULL, "model" varchar(100) NOT NULL);
CREATE TABLE "django_migrations" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app" varchar(255) NOT NULL, "name" varchar(255) NOT NULL, "applied" datetime NOT NULL);
CREATE TABLE "django_session" ("session_key" varchar(40) NOT NULL PRIMARY KEY, "session_data" text NOT NULL, "expire_date" datetime NOT NULL);
CREATE TABLE "doctor" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "password" varchar(128) NOT NULL, "last_login" datetime NULL, "first_name" varchar(100) NULL, "last_name" varchar(100) NULL, "date_of_birth" date NULL, "age" real NULL, "email" varchar(254) NOT NULL UNIQUE, "phone" varchar(150) NULL, "pincode" varchar(50) NULL, "state" varchar(50) NULL, "address" varchar(500) NULL, "rating" integer NULL, "experience" integer NULL, "country" varchar(2) NULL, "gender" varchar(100) NULL, "is_doctor" bool NULL, "is_patient" bool NULL);
CREATE TABLE "patient" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "password" varchar(128) NOT NULL, "last_login" datetime NULL, "first_name" varchar(100) NULL, "last_name" varchar(100) NULL, "date_of_birth" date NULL, "age" real NULL, "email" varchar(254) NOT NULL UNIQUE, "phone" varchar(150) NULL, "pincode" varchar(50) NULL, "state" varchar(50) NULL, "address" varchar(500) NULL, "profession" varchar(100) NULL, "last_visit" date NULL, "country" varchar(2) NULL, "depth" integer unsigned NULL, "gender" varchar(100) NULL, "is_doctor" bool NULL, "is_patient" bool NULL, "numchild" integer unsigned NOT NULL, "path" varchar(255) NULL UNIQUE);
CREATE TABLE "vaccination_chart" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(100) NOT NULL, "date_of_vaccination" date NOT NULL, "doctor_id" integer NOT NULL REFERENCES "doctor" ("id") DEFERRABLE INITIALLY DEFERRED, "patient_id" integer NOT NULL REFERENCES "patient" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE "zipcode" ("zipcode" varchar(150) NOT NULL PRIMARY KEY, "lat" varchar(150) NOT NULL, "log" varchar(150) NOT NULL, "country" varchar(150) NULL);
